import TradeItem from "./components/TradeItem";
import './Trades.css';

function Trades(props) {

    return(
        <div className="trades">
            <TradeItem
                date={props[0].date}
                name={props[0].name}
                ticker={props[0].ticker}
                pnl={props[0].pnl} 
            />
            <TradeItem
                date={props[1].date}
                name={props[1].name}
                ticker={props[1].ticker}
                pnl={props[1].pnl} 
            />
            <TradeItem
                date={props[2].date}
                name={props[2].name}
                ticker={props[2].ticker}
                pnl={props[2].pnl} 
            />
        </div>
    )

}

export default Trades;
